import logo from './logo.svg';
import './App.css';

function App() {
  const element=(
    <>
      <meta charset="UTF-8" />
      <meta http-equiv="X-UA-Compatible" content="IE=edge" />
      <meta name="viewport" content="width=device-width, initial-scale=1.0" />
      <title>Book</title>
      <img src="https://i.postimg.cc/ZK7nCwqp/124.png"/>
    </>
  )
  return (element);
}

export default App;
